<div class="disclamer">
<p>Cal Dining makes every effort to identify ingredients that may trigger allergic or other adverse reactions for individuals with food allergies or intolerance. Our staff is trained and educated on food allergies and gluten-free diets on an ongoing basis and they ensure that items marked gluten friendly are made without gluten-containing ingredients. However, due to the volume of meals served and items used each day along with food product changes from our vendors, we cannot guarantee that every allergen or gluten source in the food served will be identified and labeled. There is a small possibility that, without notice to us, manufacturers of the commercial foods we use can change the formulation at any time. Cross-contact may also occur despite our best efforts to prevent it. Customers concerned with food allergens and gluten must be aware of these risks. Cal Dining cannot assume any liability for adverse reactions to food consumed, or items one may come in contact with while eating at any Cal Dining facility or catered event. Customers with life-threatening food allergies in need to use an Epi-pen should be carrying their own at all times. Cal Dining staff is NOT trained to administer Epi-pens and CANNOT provide or administer them.
